  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<LobbyScreen />} />
        <Route path="/room/:roomId" element={<RoomPage />} />
      </Routes>
      <PeerProvider peer={myPeer}>
        <RoomPage />
      </PeerProvider>
    </div>
  );
}

export default App;
